class VoltageControlledCapacitorLimits:
    def __init__(self, Interpolate, Initial_Voltage, Elm1, Elm0, Elm3, Elm2):
        self.Interpolate = Interpolate
        self.Initial_Voltage = Initial_Voltage
        self.Elm1 = Elm1
        self.Elm0 = Elm0
        self.Elm3 = Elm3
        self.Elm2 = Elm2
